INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (4017, 16063, 'Ceftibuten', 'Food reduces the oral absorption and bioavailability of ceftibuten.  According to the product labeling, administration of ceftibuten oral suspension with a high-fat breakfast decreased the mean peak plasma concentration (Cmax) and area under the concentration-time curve (AUC) by 26% and 17%, respectively.', 'high-fat foods', 'Moderate', '', 'DDInter', 0, X'789c25ccc10dc3300c03c0553840d069b280dcd08851db0a2419c9f815da0f1f3c90bb82d39711439e36a4432d438aab5dd1746e78b3462b2b38ffe6cbafdca4c14f5dfd4021423ee912e8140fc4ad48334fab9aef6ad0c95f07a9c14c0c4a7f7d0149102f9e', NULL, X'');
