INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (4020, 2224, 'Cefoperazone', 'Some cephalosporins may occasionally induce a disulfiram-like reaction when coadministered with alcohol.  The interaction has been reported for cefamandole, cefoperazone, cefotetan, and moxalactam.  These agents contain an N-methylthiotetrazole (NMTT) side chain that may inhibit aldehyde dehydrogenase (ALDH) similar to disulfiram.  Following ingestion of alcohol, inhibition of ALDH results in increased concentration of acetaldehyde, the accumulation of which produces an unpleasant physiologic response referred to as the ''disulfiram reaction''.  Symptoms include flushing, throbbing in head and neck, throbbing headache, respiratory difficulty, nausea, vomiting, sweating, thirst, chest pain, palpitation, dyspnea, hyperventilation, tachycardia, hypotension, syncope, weakness, vertigo, blurred vision, and confusion.  Severe reactions may result in respiratory depression, cardiovascular collapse, arrh', 'alcohol', 'Moderate', '', 'DDInter', 0, X'789c358dc10d02310c045bd906a013108f6bc0720cb694b3a3d839dae740e2378f19cd83cac42b3185c50ef3175886528f1c31cd136f2b45a9e07edb36a435012b992335566fa023acfd040ee7d8adc80b2b05f104750e8d0ef2f6e7cba9d5d97f5763465b5c79fd007258328b', NULL, X'');
