INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (4071, 468, 'Albendazole', 'Food enhances the oral bioavailability of albendazole, which is rapidly converted by hepatocytes and intestinal mucosal cells into the active metabolite, albendazole sulfoxide (ABZSX), following absorption.  The proposed mechanism is stimulation of gastric acid secretion, as the absorption of albendazole is thought to be pH-dependent.  According to the product labeling, plasma concentrations of ABZSX are up to 5-fold higher on average when albendazole is administered with a fatty meal (fat content approximately 40 g) compared to administration in the fasted state.', 'high-fat foods', 'Moderate', '', 'DDInter', 0, X'789c4d8dc111c2300c045bb90298b44103342061792c50ac8c2d03a17a9cc987cf3d76e6766f0ea97d34c14a1f5dc9e06d0e71f7b6857abd808ca526faba097af161092c087a4ac55ba320bba705b836da24b7a181c7d0fb61dce7b91f854275822872ea599d5ea446aca6b1c3f37f65f90120f8370f', NULL, X'');
INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (4072, 470, 'Albendazole', 'Food enhances the oral bioavailability of albendazole, which is rapidly converted by hepatocytes and intestinal mucosal cells into the active metabolite, albendazole sulfoxide (ABZSX), following absorption.  The proposed mechanism is stimulation of gastric acid secretion, as the absorption of albendazole is thought to be pH-dependent.  According to the product labeling, plasma concentrations of ABZSX are up to 5-fold higher on average when albendazole is administered with a fatty meal (fat content approximately 40 g) compared to administration in the fasted state.', 'high-fat foods', 'Moderate', '', 'DDInter', 0, X'789c4d8dc111c2300c045bb90298b44103342061792c50ac8c2d03a17a9cc987cf3d76e6766f0ea97d34c14a1f5dc9e06d0e71f7b6857abd808ca526faba097af161092c087a4ac55ba320bba705b836da24b7a181c7d0fb61dce7b91f854275822872ea599d5ea446aca6b1c3f37f65f90120f8370f', NULL, X'');
