INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (4147, 16649, 'Chlorthalidone', 'Many psychotherapeutic and CNS-active agents (e.g., anxiolytics, sedatives, hypnotics, antidepressants, antipsychotics, opioids, alcohol, muscle relaxants) exhibit hypotensive effects, especially during initiation of therapy and dose escalation.  Coadministration with antihypertensives and other hypotensive agents, in particular vasodilators and alpha-blockers, may result in additive effects on blood pressure and orthostasis.', 'alcohol', 'Moderate', '', 'DDInter', 0, X'', NULL, X'');
INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (4148, 274, 'Cinacalcet', 'Food enhances the oral absorption and bioavailability of cinacalcet.  According to the product labeling for cinacalcet, administration with a high-fat meal increased the peak plasma concentration (Cmax) and area under the concentration-time curve (AUC) of cinacalcet by 82% and 68%, respectively, compared to administration in the fasting state.  The Cmax and AUC were increased 65% and 50%, respectively, when cinacalcet was administered with a low-fat meal compared to fasting.', 'high-fat foods', 'Moderate', '', 'DDInter', 0, X'789c4dccc10d03310844d156a68068abd906b021320a86958db349f7f13197b97ccd3b03e2730d41a78f7632c4d84365c6b852c31fa8ea54c9aa24668b658c2220eeea3a5386306ecdb67fd0de859552ec0b7aee064217b203389b20a998e4fc53925ee2b85bd8169de191607d2b6f747b75acd9848f1fc4613c53', NULL, X'');
